CREATE TABLE RAM(
   id                 INTEGER  NOT NULL PRIMARY KEY 
  ,name               VARCHAR(146) NOT NULL
  ,price              NUMERIC(7,2)
  ,speed              VARCHAR(6) NOT NULL
  ,modules            VARCHAR(5) NOT NULL
  ,price_per_gb       NUMERIC(7,3)
  ,color              VARCHAR(14)
  ,first_word_latency NUMERIC(6,3) NOT NULL
  ,cas_latency        NUMERIC(3,1) NOT NULL
);
